import React from "react";

const About = () => {
  return (
    <div className="min-h-screen flex flex-col items-center justify-center bg-gray-100 p-4">
      <h1 className="text-3xl font-bold text-gray-800">About This Project</h1>
      <p className="mt-3 text-gray-600 text-lg text-center max-w-2xl">
        This is a simple CRUD app built with React and TailwindCSS. It's a demonstration
        of REST APIs, frontend state handling, and clean design. Similar to a mini Shopify site.
      </p>
    </div>
  );
};

export default About;
